CREATE DEFINER=`schooladmin`@`%` PROCEDURE `SpFeeplanHeadDetails`(
	IN `schoolId` bigint(20),
    IN `acadmicYear` varchar(10)
)
BEGIN
-- insert into FeePlanFeeHeadInvoice 
select
	s.id as merchantId
    ,ay.academicYear
    ,fp.feePlanName
    ,st.studentCode
    ,c.className
    ,ct.categoryName
    ,fh.chargeHeadName
    ,fh.feeHeadName
    ,fr.frequencyName
    ,fpd.feeCharges
    ,fpd.dueDate
    ,fpd.sequenceNumber
From
	academicyear ay 
    inner join school s on ay.schoolId = s.id
    inner join feeplan fp on ay.schoolId=fp.schoolId
    inner join feeplanassociation fpa on fp.id=fpa.feeplanId
    inner join feeplanheaddetails fpd on fp.id=fpd.feePlanId
    inner join feehead fh on fpd.feeHeadId=fh.id
    inner join frequency fr on fh.frequencyId=fr.id
    inner join class c on fpa.classId=c.id
    inner join category ct on fpa.categoryId=ct.id
    inner join student st on c.id=st.classId and ct.id=st.categoryId
where
	ay.academicYear=acadmicYear and
    ay.schoolId=schoolId
order by
	studentCode,fpd.sequenceNumber, className,categoryName,chargeHeadName;
END ;;
